import React from 'react';
import "../css/maincontents.css";
import Footer from "../../Footer/footer";

function Item({name, image, price, details}) {
  return (
    <li className="item">
      <a className="cloth-box">
        {/* <img src={require("../img/test_1.jpg")} alt="사진의 네임"/> */}
      </a>
      <div className="detail-box">
        <p className="name"><a href="#"></a></p>
        <p className="price"><span className="num">100,000</span>원</p>
        <p className="details">트렌디하고 내츄럴한 무드의 밴딩 와이드 생지데님.</p>
      </div>
      <input type="checkbox" class="hide" id="check-1" />
      <label for="check-1"></label>
    </li>
  )
}
const ItemList = [
  {
    name: "클랫 밴딩 와이드 생지데님",
    image: "../img/test_1.jpg",
    price: "100,000",
    details: "트렌디하고 내츄럴한 무드의 밴딩 와이드 생지데님",
  },
  {
    name: "메린 루즈핏 싱글수트",
    image: "../img/test_2.jpg",
    price: "75,000",
    details: "부담없이, 멋스럽고 내츄럴한 와이드 핏라인의 슬랙스.",
  },
  {
    name: "메린 밴딩 와이드 슬랙스",
    image: "../img/test_3.jpg",
    price: "29,000",
    details: "트렌디하고 내츄럴한 루즈핏 라인의 싱글수트.",
  },
]

function MainContents(){
  return (
    <>
      <div id="maincontents" class="wrap">
        <div className="best-items container">
          <p className="title">#Best items</p>
          <div className="item"></div>
        </div>

        <div className="new-items container">
          <p className="title">#new items</p>
          <ul className="item-box">
            {ItemList.map(cloth => (<Item name={cloth.name} image={cloth.image}/>))}
          </ul>
          
        </div>

        <Footer />
      </div>
    </>
  )
}

export default MainContents;
